import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

const PhoneTicketDetails = () => {
    const { ticketId } = useParams();
    const [ticketDetails, setTicketDetails] = useState(null);
    useEffect(() => {
        if (ticketId) {
            fetch(`/api/ticket/phone/${ticketId}`)
                .then((response) => response.json())
                .then((data) => setTicketDetails(data))
                .catch((error) =>
                    console.error("Error fetching ticket details:", error)
                );
        }
    }, [ticketId]);
    if (!ticketDetails) {
        return <div>Loading...</div>;
    }
    console.log(ticketDetails);
    return (
        <>
            {ticketDetails.map((ticket, index) => (
                <div key={index} className="text-navy-700 mx-0 mb-2.5 mt-5 text-center font-semibold dark:text-white">
                    <h1 className="text-navy-700 mx-0 mb-2.5 text-center text-[1em] font-semibold dark:text-white">
                        Ticket Number: {ticket.reference}
                    </h1>
                    <div className="min-w-screen dark:bg-navy-900 relative mx-auto my-5 rounded-2xl bg-white p-5 py-10 shadow-[2px_2px_5px_rgba(0,0,0,0.05)]">
                        <div className="grid grid-cols-1 gap-x-6 gap-y-8 sm:grid-cols-6">
                            <div className="flex sm:col-span-3">
                                <p className={`mb-1 text-${ticket.reference ? "navy-900" : "red-700"} dark:text-gray-200`}>
                                    <strong className="text-navy-900 dark:text-white">Reference:</strong>
                                    {ticket.reference ? ticket.reference : "Non rempli"}
                                </p>
                            </div>
                            <div className="flex sm:col-span-3">
                                <strong className="text-navy-900 dark:text-white">Status:</strong>
                                <p className={`ml-2 mb-1 text-${ticket.status ? "navy-900" : "red-700"} dark:text-gray-200`}>
                                    {ticket.status ? ticket.status : "Non rempli"}
                                </p>
                            </div>
                        </div>
                    </div>
                </div>
            ))}
        </>
    )
}
export default PhoneTicketDetails
